import React from 'react';
import useWebAnimations from "@wellyshen/use-web-animations";
import sirzia from './../images/sirzia.jpeg';
import './home.css';
function Home(){

    const imageframe =   [
        {transform: 'translateY(0px) scale(1)'},
        { transform: 'translateY(50px) scale(0.8)'},
        {transform: 'translateY(0px) scale(1)'}];
    const timings =   {duration: 4500, iterations: Infinity, playbackRate:0.8};
    const {Movement} = useWebAnimations({keyframes:imageframe,timing:timings});    

    return(
        <div className="div">
            <img  src={sirzia} ref={Movement} >
            </img>

        </div>
    )
}
export default Home;
